import React, { Component } from "react"
import Footer from "../../components/Footer/footer.js"
import API from "../../utils/API"
import { InputGroup, FormControl } from 'react-bootstrap'


export default class Images extends Component {

  constructor(props){
    super(props)
    this.state = {
      pageData: props.pageData,
    }
  }

  componentDidMount() {
    this.findPage()
  }

  findPage() {
    API.findPage(1000,1)
      .then(res => {
        console.log('images page payload', res.data)
      })
      .catch(err => console.log(err))
  }

  render() {
    return (
      <div>

        <br /><br />
        <h1 className="text-info">
          {this.state.pageData.title}
        </h1>
        <br /><br />

        <InputGroup size="lg" className="navbar bg-secondary">
          <InputGroup.Prepend>
            <InputGroup.Text id="inputGroup-sizing-lg">Sol</InputGroup.Text>
          </InputGroup.Prepend>
          <FormControl aria-label="Large" aria-describedby="inputGroup-sizing-sm" />
        </InputGroup>

        <InputGroup size="lg">
          <InputGroup.Prepend>
            <InputGroup.Text id="inputGroup-sizing-lg">Day</InputGroup.Text>
          </InputGroup.Prepend>
          <FormControl aria-label="Large" aria-describedby="inputGroup-sizing-sm" />
        </InputGroup>

        <br /><br />


        <Footer />
      </div>
    )
  }

}
